import{_ as e,c as a,o,U as r}from"./chunks/framework.LCBkioTP.js";const b=JSON.parse('{"title":"chrome provisional headers are shown 是什么意思（转）","description":"","frontmatter":{},"headers":[],"relativePath":"misc/352.md","filePath":"misc/352.md"}'),t={name:"misc/352.md"},s=r('<h1 id="chrome-provisional-headers-are-shown-是什么意思-转" tabindex="-1">chrome provisional headers are shown 是什么意思（转） <a class="header-anchor" href="#chrome-provisional-headers-are-shown-是什么意思-转" aria-label="Permalink to &quot;chrome provisional headers are shown 是什么意思（转）&quot;">​</a></h1><blockquote><p>转载来源 <a href="https://juejin.im/post/5c00980751882518805add83" target="_blank" rel="noreferrer">provisional headers are shown 知多少</a></p></blockquote><p>启发的一篇文章(<a href="https://stackoverflow.com/questions/21177387/caution-provisional-headers-are-shown-in-chrome-debugger" target="_blank" rel="noreferrer">详情点击</a>)。</p><p>摘抄部分如下：</p><blockquote><p>The resource could be being blocked by an extension (AdBlock in my case).The message is there because the request to retrieve that resource was never made, so the headers being shown are not the real thing. As explained in the issue you referenced, the real headers are updated when the server responds, but there is no response if the request was blocked.</p></blockquote><p>资源可能被一些扩展程序拦截 。</p><p>另外还有一句：</p><blockquote><p>I believe it happens when the actual request is not sent. Usually happens when you are loading a cached resource.</p></blockquote><p>真正请求并未被发送，当使用缓存时经常发生。</p><p>之所以会出现这个信息是因为获取相关资源的请求并没有发出，所以 <code>headers</code> 被展示并不是真正的信息。</p><p>就像提到的那样，真正的 <code>header</code> 只有在服务端返回的时候会更新。当请求被拦截后，并没有返回。</p><p>基于这个情况开始猜测原因所在：</p><h3 id="猜测一、请求跨域被拦截" tabindex="-1">猜测一、请求跨域被拦截 <a class="header-anchor" href="#猜测一、请求跨域被拦截" aria-label="Permalink to &quot;猜测一、请求跨域被拦截&quot;">​</a></h3><p>虽然现在网站的静态资源都会存在专门的静态域名下面，和 <code>html</code> 域名可能不一致。</p><p>但是基本都是基于 <code>CORS</code> 来解决这个问题，所以不存在这个问题。</p><p>再有就是，我们这种情况首次请求的时候不会发生，如果有跨域，应该都被 <code>block</code>。</p><p>另外如果是被拦截，那么请求应该不会被响应的，我们这里显然得到了正确的响应。 这种被排除。</p><h3 id="猜测二、服务器未及时响应" tabindex="-1">猜测二、服务器未及时响应 <a class="header-anchor" href="#猜测二、服务器未及时响应" aria-label="Permalink to &quot;猜测二、服务器未及时响应&quot;">​</a></h3><p>这种猜测和一差不多，特定情况下才会出现，跟服务器关联不大。</p><h3 id="猜测三、被扩展程序拦截" tabindex="-1">猜测三、被扩展程序拦截 <a class="header-anchor" href="#猜测三、被扩展程序拦截" aria-label="Permalink to &quot;猜测三、被扩展程序拦截&quot;">​</a></h3><p>作为一个开发人员，大家的 <code>chrome</code> 上肯定装了不少的插件。这种原因还是有可能的。</p><p>我们可以通过 <code>chrome://net-export/</code> 来根据关键字查找相关请求，然后具体去看相关状态。</p><h3 id="本地缓存" tabindex="-1">本地缓存 <a class="header-anchor" href="#本地缓存" aria-label="Permalink to &quot;本地缓存&quot;">​</a></h3><p>结合上面的分析，我们可以缩小到缓存上面。冲着这个目标，我们继续去看下相关资料。</p><p>最后在一篇<a href="https://did2memo.net/2017/01/23/chrome-devtools-provisional-headers-are-shown/" target="_blank" rel="noreferrer">日文资料</a>里找到了相关解释。</p><p>似乎只从缓存中获得的通信显示为“显示临时标题”（或“执行”）。</p><p>因为该文件是从缓存中获取的，并且未进行通信。</p><p>所以详细标头并不会显示。</p><h3 id="原因-未与服务端正确通信" tabindex="-1">原因：未与服务端正确通信 <a class="header-anchor" href="#原因-未与服务端正确通信" aria-label="Permalink to &quot;原因：未与服务端正确通信&quot;">​</a></h3><p>回过头来看，前面提到的那么多情况其实都是与服务器没有进行或者完成正确的通信，所以只展示临时信息。</p><h3 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-label="Permalink to &quot;总结&quot;">​</a></h3><p><code>provisional headers are shown</code> 出现的情况有这么几种：</p><ul><li>跨域，请求被浏览器拦截</li><li>请求被浏览器插件拦截</li><li>服务器出错或者超时，没有真正的返回</li><li>强缓存 <code>from disk cache</code> 或者 <code>from memory cache</code>，此时也不会显示</li></ul>',33),h=[s];function c(i,n,d,l,p,u){return o(),a("div",null,h)}const _=e(t,[["render",c]]);export{b as __pageData,_ as default};
